강사님께서 말씀주신 실행시간에 따른 log 레벨 달리하는 부분 적용 해보았습니다.  필요하신 분 있으면 참고해 주세요. 
(오류 발생 시에만 로그 남기는 부분은 @AfterThrowing 어드바이스를 사용하면 될거 같습니다 - Retry에서는 재시도 제거)
피드백 사항 있으면 말씀 부탁합니다. ^^;
1. 어노테이션 - 기본값 1000
@Target(ElementType.METHOD)@Retention(RetentionPolicy.RUNTIME)public @interface CheckTime {    int value() default 1000;}
2. Aspect
@Around("@annotation(checkTime)")public void checkTimer(ProceedingJoinPoint joinPoint, CheckTime checkTime) throws Throwable {    int mills = checkTime.value();    StopWatch stopWatch = new StopWatch();    stopWatch.start();    joinPoint.proceed();    stopWatch.stop();    long totalTimeMillis = stopWatch.getTotalTimeMillis();    Signature signature = joinPoint.getSignature();    String methodName = signature.getName();    if (totalTimeMillis <= mills) {        log.info("methodName: {}, 실행시간 = {}ms", methodName, totalTimeMillis);    }else if (totalTimeMillis > mills) {        log.error("methodName: {}, 실행시간 = {}ms", methodName, totalTimeMillis);    }}
3. repository 레이어- 랜덤으로 실행시간 적용
@CheckTime(value = 2000)public String save(String itemId) {    seq++;    if (seq % 5 == 0) {        throw new IllegalStateException("예외 발생");    }    sleep();    return "ok";}private void sleep() {    int[] ints = {1000, 2000,3000,4000,5000};    double random= Math.random();    int num = (int) Math.round(random * (ints.length-1));    try {        Thread.sleep(ints[num]);    } catch (InterruptedException e) {        e.printStackTrace();    }}
영한님 항상 감사합니다!!

function transfer(uint _value) public returns (bool){
// only PASS - remain balance is more than requested value
require(getBalance() >= _value);
 
// +type casting
address payable receiver = payable(msg.sender);

// then send transfer
receiver.transfer(_value);

return true;
}

TransientPropertyValueException 에러 발생 이유는 주로 부모객체에서 자식객체를 한번에 저장하려고할때 발생하는 것으로, 자식 객체가 아직 데이터베이스에 저장되지 않았기 때문입니다.
@OneToMany, @ManyToOne 사용 시 cascade 설정을 해주신다면 해결할 수 있을 것입니다.

CascadeType.ALL을 통해 영속성 전이가 발생해 부모객체를 저장할때 자식객체도 함께 저장할 수 있습니다.

바이너리 식으로 미로를 생성하게 되면,
빈칸에서 오른쪽이나 아래쪽을 뚫어나가며,
무조건 연결을 하는 특성이 있습니다.
그런데
길 끝으로 가면, 한 쪽으로밖에 연결을 할 수 밖에 없게 되어
가장자리가 비게 되는 현상이 발생합니다.
어차피 길 자체의 방향이 우측과, 아래를 향하고 있으니
어차피 비워야 길이 모두 연결되긴 하지만요.

근데 SliderWinder 방식을 사용하게 되면
한 줄에 무조건 아래쪽으로 길이 랜덤하게 생기게 됩니다.
어떻게 코드를 짜도 일단 아래쪽으로 내려가기는 한다는 말이 되는거죠.
그러니까, 굳이 바이너리처럼 우측 끝을 비울 필요는 없다는게 되는거죠.
어차피 어디로든 내려가게 되있으니까요.

다만,
모든 길이 아래쪽으로 향하고 있기에,
아래쪽 x축의 경우,
sliderwinder의 핫플레이스가 됩니다.
이 부분을 잘못 채웠다가는 길이 분단되는 현상이 일어날 수 있습니다.
이 부분도 개선을 하려면 가능은 할 것으로 보였으나,
코드가 복잡해질 것 같기에 패스.

결과물 코드는
x축의 마지막 아랫부분만 비고,
y축의 오른쪽 끝은 자유롭게 채우는 형태로 되는겁니다.
사실 코드에 별다른 점은 없습니다.
y축에서 방향을 강제하지 않았다는 점과 오른쪽으로 가는게 끊기는 지점에서도 내려갈 수 있게 쓴 것 말고는 딱히 다른 점은 없습니다.




public void Maze2(int size)
        {

            {
                //길막생성
                for (int y = 0; y < _size; y++)
                {
                    for (int x = 0; x < _size; x++)
                    {
                        if (x % 2 == 0 || y % 2 == 0)
                            _tile[y, x] = TileType.Wall;
                        else
                            _tile[y, x] = TileType.Empty;

                        if (x == 0 || x == _size - 1 || y == 0 || y == size - 1)
                            _tile[y, x] = TileType.Wall;
                    }
                }
                //길막생성
                Random rand = new Random();
                int count = 0;
                for (int y = 0; y < _size; y++)
                {
                    for (int x = 0; x < _size; x++)
                    {
                        if (x % 2 == 0 || y % 2 == 0)
                            continue;
                        if (x == _size - 2 && y == _size - 2)
                            continue;

                        if (y == _size - 2)
                        {
                            _tile[y, x + 1] = TileType.Empty;
                            continue;
                        }

                        if (rand.Next(0, 2) == 0 && x!=size-2)
                        {
                            count++;
                            _tile[y, x + 1] = TileType.Empty;
                        }
                        else if(y!=size-2)
                        {
                            _tile[y + 1, x - 2*rand.Next(0, count)] = TileType.Empty;
                            count = 0;

                        }


                    }
                }
            }
        }

안녕하세요~ 그랩 선생님ㅎㅎ
공부하다 도저히 이해가 안되서 질문해봅니다ㅜ
짝수만 나오게 하는 반복문입니다.
for (i=0; i<11; i++) {
    if(i % 2 !== 0){
    continue;
    }
console.log(i);
}

이 코드인데 (i % 2 !== 0) 이부분이 잘 이해가 안되는게 i=4일때 나머지가 2인데 왜 continue가 안되나요??

웹뷰를 만들려고 여기까지와서 강좌를 듣게 되고, 많은 도움 받았습니다. 웹뷰를 이용해서 간단한 엡을 만들려고하는데. 상단에 나타난 header부분(각종 아이콘과 베터리아이콘이 보이는부분) 그리고 하단의 bottom의 버튼들이 있는 부분의 배경색을 검정색으로 바꾸고 싶은데.. 여기 강좌를 봐도... 다른 사이트를 검색을 해도 나오지 않아서 여쭤봅니다. 제 코드는 아래와 같습니다. 
